      <a><span className={`iconfont icon_gift-solid`}/>最新優惠</a>
      <a><span className={`iconfont icon_sack-dollar-solid`}/></a>
      <a><span className={`iconfont iconHR`}/></a>
      <a><span className={`iconfont icon_user-solid`}/></a>
    </nav>
  );
}

export default BottomNav;
